import React from 'react';
import { FaCog, FaComments, FaSignOutAlt } from 'react-icons/fa';

function Sidebar() {
  return (
    <div className="sidebar">
      <ul>
        <li><FaCog /> Settings</li>
        <li><FaComments /> Feedback</li>
        <li><FaSignOutAlt /> Logout</li>
      </ul>
    </div>
  );
}

export default Sidebar;
